svg.script:
    var going_up = true;
    var bar_fill = 50.000000;
    var bar_obj;
    var text_obj;
    var pv_text_obj;
    var tcount=0;
    var xReq;
    var hrf;

function BarObject(x, y, height)
{
  this.x = x;
  this.y = y;
  this.height=height;
  this.max = 400.0;
  this.min = 0.0;
  console.log("new BarObject: " + this.x + ", " + this.y  + ", " + this.height);
  this.the_bar_obj = document.getElementById("my_rect");
  console.log("this.the_bar_obj: " + this.the_bar_obj);
}

function convert_scale(euval, y, height, min, max)
{
  console.log("convert scale:" + euval + ", " + y  + ", " + height  + ", " + min  + ", " + max);
  var fraction = (euval-min ) / (max - min);
  var span = (height * fraction);
  var scale = y + height - span;
  if (scale > y+height) scale = y+height;
  if (scale < y) scale = y;
  console.log("convert scale:" + fraction  + ", " + span + ", " + scale);
  return scale;
}

function f_set_pv(a_pv)
{
  var fraction = (a_pv - this.min ) / (this.max - this.min);
  var bar_height = fraction * (this.height);
  if (bar_height < 0.0) bar_height = 0.0
  if (bar_height > this.height) bar_height = this.height
  console.log("set_pv:" + a_pv + ", " + fraction  + ", " + bar_height  + ", " + this.min  + ", " + this.max);
  this.the_bar_obj.setAttribute("height", bar_height);
}
function f_set_limits(a_min, a_max)
{
  var inc
  var the_id
  var i
  console.log("set_limits:" + a_min + ", " + a_max);
  if (a_max > a_min)
  {
    this.min = a_min;
    this.max = a_max;
  }
  else
  {
    this.min = a_max;
    this.max = a_min;
  }
  if (this.max > 200) inc = 100; else inc = 10;
  for (var i=0; i<=5; i++)
  {
    the_id = "major_" + i;
    console.log("text id:" + the_id);
    text_obj = document.getElementById(the_id);
    text_obj.textContent=i * inc;
  }
}

function f_set_alarms(alarm_hi, caution_hi, caution_lo, alarm_lo, alarm_hi_en, caution_hi_en, caution_lo_en, alarm_lo_en)
{
  var bottom;
  var top;
  var rect_obj;
  var pvals;

  pvals = "vals:" + alarm_hi + ", " + caution_hi + ", " + caution_lo + ", " + alarm_lo + ", "
  pvals += alarm_hi_en + ", " +  caution_hi_en + ", " + caution_lo_en + ", " +  alarm_lo_en;
  console.log(pvals);
  rect_obj = document.getElementById("caution_hi_rect");
  if (caution_hi_en)
  {
    bottom = convert_scale(caution_hi, this.y, this.height, this.min, this.max);
    console.log("Caution Hi:" + bottom);
    rect_obj.setAttribute("height", bottom - this.y);
  }
  else
  {
    console.log("Caution Hi NOT enabled");
    rect_obj.setAttribute("height", 0);
  }

  rect_obj = document.getElementById("alarm_hi_rect");
  if (alarm_hi_en)
  {
    bottom = convert_scale(alarm_hi, this.y, this.height, this.min, this.max);
    console.log("Alarm:" + bottom);
    rect_obj.setAttribute("height", bottom - this.y);
  }
  else
  {
    console.log("Alarm Hi NOT enabled");
    rect_obj.setAttribute("height", 0);
  }

  rect_obj = document.getElementById("caution_lo_rect");
  if (caution_lo_en)
  {
    top = convert_scale(caution_lo, this.y, this.height, this.min, this.max);
    rect_obj.setAttribute("y", top);
    rect_obj.setAttribute("height", this.height - (top - this.y));
  }
  else
  {
    console.log("Caution Low NOT enabled");
    rect_obj.setAttribute("y", this.y + this.height);
    rect_obj.setAttribute("height", 0);
  }
  rect_obj = document.getElementById("alarm_lo_rect");
  if (alarm_lo_en)
  {
    top = convert_scale(alarm_lo, this.y, height, this.min, this.max);
    rect_obj.setAttribute("y", top);
    rect_obj.setAttribute("height", this.height - (top - this.y));
  }
  else
  {
    console.log("Alarm Low NOT enabled");
    rect_obj.setAttribute("y", this.y + this.height);
    rect_obj.setAttribute("height", 0);
  }

}

BarObject.prototype.set_pv=f_set_pv;
BarObject.prototype.set_limits=f_set_limits;
BarObject.prototype.set_alarms=f_set_alarms;

var bar_object_1;


    function onResponse()
    {
      if (xReq.readyState != 4)  { return; }
      val = JSON.parse(xReq.responseText);
      pv_text_obj.textContent=(val.pv + " " + val.eulabel);
      bar_object_1.set_pv(val.pv)
      val.pv = val.pv * 0.200000;
      xReq.abort(); <!-- set the ready state back to 0 --> 
      //bar_obj.setAttribute("height", val.pv);
      //bar_obj.setAttribute("y", 120.000000 - val.pv);
    }


    function intervalHandler()
    {
      if (xReq.readyState != 0)  { return; }
      xReq.open("GET", hrf, true);
      xReq.send(null);
    }

