    function cfg_read()
    {
      xcReq = new XMLHttpRequest();
      xcReq.onreadystatechange = cfg_onResponse;
      xcReq.open("GET", "http://" + location.hostname + "/helloworld/config" + location.search, true);
      xcReq.send(null);
    }

    function load()
    {
      bar_object_1 = new BarObject(50.000000, 20.000000, 100.000000);
      bar_obj = document.getElementById("my_rect");
      text_obj = document.getElementById("my_text");
      pv_text_obj = document.getElementById("pv_text");
      //text_obj.textContent=" host " + location.hostname + " end " + location.host + "--" + location.href;
      hrf = "http://" + location.hostname + "/helloworld/tag" + location.search
      xReq = new XMLHttpRequest();
      xReq.onreadystatechange = onResponse;
      //text_obj.textContent=hrf;
      cfg_read();
      var interval = setInterval("intervalHandler()", 250);
    };


    function do_bar()
    {
      if (going_up)
      {
        bar_fill = bar_fill + 1.000000;
        if (bar_fill > 100.000000)
        {
          bar_fill = 100.000000;
          going_up = false;
          text_obj.textContent="Hit Top";
        }
      } 
      else
      {
        bar_fill = bar_fill - 1.000000;
        if (bar_fill < 0)
        {
          bar_fill = 0;
          going_up = true;
          text_obj.textContent="Hit Bottom";
        }
      }
      bar_obj.setAttribute("height", bar_fill);
      bar_obj.setAttribute("y", 120.000000 - bar_fill);

      tcount++;
      if (tcount > 5)
      {
        pv_text_obj.textContent=(Math.round(10*((bar_fill / 100.000000) * 500.000000)))/10 + " PSI";
        tcount=0;
      }
    };
